third_join_cloud_conference_way:
Join Conference: 

 1) Join from Yealink VC Mobile or Yealink VC Desktop: If you already received a conference invitation before, you could easily find it in Calender. If you do not get a conference invitation, you could join this meeting by input conference ID and password;

 2) Join from other SIP Room System: Please dial %1$s.

third_join_yms_conference_way:
Join Conference: 

 1) Join from Yealink VC Mobile or Yealink VC Desktop: If you already received a conference invitation before, you could easily find it in Calender. If you do not get a conference invitation, you could join this meeting by input conference ID and password;

 2) Join from other SIP Room System: Please dial %1$s;

 3) Join from other H.323 Room System: Please dial %2$s.
